var irr = '';
var datalen = irr.length / 2;
var irrArrayBuffer = new ArrayBuffer(datalen);
var view = new Uint8Array(irrArrayBuffer);
var s = irr.substr(0, 2);
var n = parseInt(s, 16);
view[0] = n;
for (var i = 1; i < datalen; i++) {
	s = irr.substr(i * 2, 2);
	n = parseInt(s, 16);
	view[i] = n;
}
